import React from "react";
import { Link } from "react-router-dom";
import { Amazon_Logo } from "../../assets/Images";
import search from "./searchOption";
import SearchIcon from "@mui/icons-material/Search";
import LocationOnOutlinedIcon from "@mui/icons-material/LocationOnOutlined";

const TopNav = () => {
  const SearchOptions = search.map((item, index) => {
    return (
      <option key={index} value={item}>
        {item}
      </option>
    );
  });
  return (
    <nav className="TopNav">
      <div className="TopNav__left flex">
        <Link to={"/"} className="TopNav__left__Logo">
          <img src={Amazon_Logo} alt="" />
        </Link>
        <Link to={"/address"} className="TopNav__left__address flex-column">
          <span>Hello{}</span>
          <div>
            <LocationOnOutlinedIcon />
            <p>Select your address</p>
          </div>
        </Link>
      </div>
      <div className="TopNav__middle flex">
        <select name="searchOptions" id="searchoptions">
          <option value="" disabled selected hidden>All</option>
          {SearchOptions}
        </select>
        <input type="text" />
        <SearchIcon className="TopNav__middle__search" />
      </div>
      <div className="TopNav__right"></div>
    </nav>
  );
};

export default TopNav;
